CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerPagos` ()   BEGIN
    SELECT 
        p.id_pago,
        p.monto_pagado,
        p.fecha_pago,
        p.metodo_pago,
        p.estado_pago,
        p.referencia_pago,
        r.id_reserva,
        CONCAT(c.nombres, ' ', c.apellidos) AS nombre_cliente
    FROM pagos p
    INNER JOIN reservas r ON p.id_reserva = r.id_reserva
    INNER JOIN clientes c ON r.id_cliente = c.id_cliente;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerReservas` ()   BEGIN
