        r.fecha_reserva,
        r.fecha_devolucion,
        r.estado,
        r.observaciones
    FROM reservas r
    INNER JOIN clientes c ON r.id_cliente = c.id_cliente;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerTrajes` ()   BEGIN
